import React, { Component, Fragment } from "react";
import { IoHeartOutline } from "react-icons/io5";
import {
  Card,
  CardImg,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
  Button,
} from "reactstrap";

export default class ItemLibrary extends Component {
  render() {
    return (
      <React.Fragment>
        
          <Card>
            <CardImg alt="cover" top width="100%" />
            <CardBody>
              <CardTitle tag="h5"></CardTitle>
              <CardSubtitle className="mb-2 text-muted" tag="h6">
               
              </CardSubtitle>
              <Button outline>Read</Button>{" "}
              <Button color="danger" outline>
                Remove
              </Button>{" "}
              <IoHeartOutline size={35} />
            </CardBody>
          </Card>
     
      </React.Fragment>
    );
  }
}
